member.example:
This example demonstrates how to get an image of DICOM frame and
save it as PNG file.

''' <summary>
''' Gets an image of DICOM frame and saves image to a PNG file.
''' </summary>
''' <param name="filePath">Path to a DICOM file.</param>
''' <param name="pageIndex">Index of DICOM page.</param>
Public Sub GetAndSaveDicomImage(filePath As String, pageIndex As Integer)
    ' open DICOM file
    Using dicomFile As New DicomFile(filePath)
        ' get DICOM page
        Dim page As DicomFrame = dicomFile.Pages(pageIndex)
        ' get DICOM image
        Dim image As VintasoftImage = page.GetImage()
        ' save image to a PNG file
        image.Save("E:\DicomImage.png")
    End Using
End Sub


/// <summary>
/// Gets an image of DICOM frame and saves image to a PNG file.
/// </summary>
/// <param name="filePath">Path to a DICOM file.</param>
/// <param name="pageIndex">Index of DICOM page.</param>
public void GetAndSaveDicomImage(string filePath, int pageIndex)
{
    // open DICOM file
    using (DicomFile dicomFile = new DicomFile(filePath))
    {
        // get DICOM page
        DicomFrame page = dicomFile.Pages[pageIndex];
        // get DICOM image
        VintasoftImage image = page.GetImage();
        // save image to a PNG file
        image.Save(@"E:\DicomImage.png");
    }
}

This example demonstrates how to get raw DICOM image, apply VOI LUT to DICOM image,
add overlays to DICOM image and save DICOM image as PNG file.

''' <summary>
''' Gets raw DICOM image, applies a VOI LUT to the DICOM image,
''' draws the overlay objects to the DICOM image, saves DICOM image to a PNG file.
''' </summary>
''' <param name="filePath">Path to DICOM file.</param>
''' <param name="pageIndex">Index of DICOM page.</param>
Public Sub GetAndSaveDicomImageWithOverlaysAndAdjustImageWindow(filePath As String, pageIndex As Integer)
    ' open DICOM file
    Using dicomFile As New DicomFile(filePath)
        ' get DICOM page
        Dim page As DicomFrame = dicomFile.Pages(pageIndex)


        ' get raw DICOM image

        ' create settings for decoding DICOM image
        Dim decodingSettings As New DicomDecodingSettings()
        ' specify that Modality LUT should not be applied to a DICOM image
        decodingSettings.ApplyModalityLut = False
        ' specify that VOI LUT should not be applied to a DICOM image
        decodingSettings.ApplyValueOfInterestLut = False
        ' specify that overlay objects should not be drawn on DICOM image
        decodingSettings.ShowOverlayImages = False
        ' get raw DICOM image
        Dim image As VintasoftImage = page.GetImage(decodingSettings, Nothing)


        ' apply VOI LUT to the DICOM image

        Dim applyDicomImageVoiLutCommand As New ApplyDicomImageVoiLutCommand()
        applyDicomImageVoiLutCommand.DataSets = dicomFile.DataSets
        applyDicomImageVoiLutCommand.VoiLut = New DicomImageVoiLut(128, 50)
        applyDicomImageVoiLutCommand.ExecuteInPlace(image)


        ' draw overlay objects on DICOM image

        Dim applyDicomOverlaysCommand As New ApplyDicomOverlaysCommand()
        applyDicomOverlaysCommand.OverlayImages = page.OverlayImages
        applyDicomOverlaysCommand.OverlayColor = New Rgb24Color(180, 180, 180)
        applyDicomOverlaysCommand.ExecuteInPlace(image)


        ' save image to a PNG file
        image.Save("E:\DicomImage.png")
    End Using
End Sub


/// <summary>
/// Gets raw DICOM image, applies a VOI LUT to the DICOM image,
/// draws the overlay objects to the DICOM image, saves DICOM image to a PNG file.
/// </summary>
/// <param name="filePath">Path to DICOM file.</param>
/// <param name="pageIndex">Index of DICOM page.</param>
public void GetAndSaveDicomImageWithOverlaysAndAdjustImageWindow(string filePath, int pageIndex)
{
    // open DICOM file
    using (DicomFile dicomFile = new DicomFile(filePath))
    {
        // get DICOM page
        DicomFrame page = dicomFile.Pages[pageIndex];


        // get raw DICOM image

        // create settings for decoding DICOM image
        DicomDecodingSettings decodingSettings = new DicomDecodingSettings();
        // specify that Modality LUT should not be applied to a DICOM image
        decodingSettings.ApplyModalityLut = false;
        // specify that VOI LUT should not be applied to a DICOM image
        decodingSettings.ApplyValueOfInterestLut = false;
        // specify that overlay objects should not be drawn on DICOM image
        decodingSettings.ShowOverlayImages = false;
        // get raw DICOM image
        VintasoftImage image = page.GetImage(decodingSettings, null);


        // apply VOI LUT to the DICOM image

        ApplyDicomImageVoiLutCommand applyDicomImageVoiLutCommand = new ApplyDicomImageVoiLutCommand();
        applyDicomImageVoiLutCommand.DataSets = dicomFile.DataSets;
        applyDicomImageVoiLutCommand.VoiLut = new DicomImageVoiLut(128, 50);
        applyDicomImageVoiLutCommand.ExecuteInPlace(image);


        // draw overlay objects on DICOM image

        ApplyDicomOverlaysCommand applyDicomOverlaysCommand = new ApplyDicomOverlaysCommand();
        applyDicomOverlaysCommand.OverlayImages = page.OverlayImages;
        applyDicomOverlaysCommand.OverlayColor = new Rgb24Color(180, 180, 180);
        applyDicomOverlaysCommand.ExecuteInPlace(image);


        // save image to a PNG file
        image.Save(@"E:\DicomImage.png");
    }
}

This example demonstrates how to get a DICOM image with overlays and
save it as PNG file.

''' <summary>
''' Gets DICOM image with overlay objects and saves it to a PNG file.
''' </summary>
''' <param name="filePath">Path to DICOM file.</param>
''' <param name="pageIndex">Index of DICOM page.</param>
Public Sub GetAndSaveDicomImageWithOverlays(filePath As String, pageIndex As Integer)
    ' open DICOM file
    Using dicomFile As New DicomFile(filePath)
        ' get DICOM page
        Dim page As DicomFrame = dicomFile.Pages(pageIndex)
        ' return DICOM image with overlay objects
        Dim image As VintasoftImage = page.GetImage(Nothing, True, Nothing)
        ' save image to a PNG file
        image.Save("E:\DicomImage.png")
    End Using
End Sub


